import http from "./httpService";

export async function searchUser(user_handler) {
  const { users: data } = await http.get(
    `http://localhost:3900/users/search/${user_handler}`
  );
  console.log(users);
  return rankUsers(users.data);
}

function rankUsers(users) {
  return users
    .sort((u1, u2) => u2.followers_count - u1.followers_count)
    .map((u) => u.screen_name);
}
